import React from 'react';

class NAVBAR__COMP extends React.Component {
  render() {
    return (
      <header>
        <div className="mt-2 fixed">
          <div className="flex flex-row pl-5 pr-5 whitespace-nowrap">
            <div className="ml-1 mr-10 md:ml-32 md:mr-52"><a href="/">Home</a></div>
            <nav className="text-lg">
             <a className="ml-2 mr-2 md:ml-4 md:mr-4" href="#about-me-section">About Me</a>
             <a className="ml-2 mr-2 md:ml-4 md:mr-4" href="#projects-section">Projects</a>
             <a className="ml-2 mr-2 md:ml-4 md:mr-4" href="#contact-section">Contact</a>
            </nav>
          </div>
        </div>
        <br/><br/><br/>
      </header>
    );
  }
}

function App() {
  return (
    <div className="App">
      <NAVBAR__COMP />
    </div>
  );
}

export default App;
